function showContractDetail(json){
	 $("#content").empty();
 	var titleli=$("<li>").addClass("list-group-item list-group-item-warning").append("查询到"+json.length+"条记录").css({"text-align":"center","font-weight":"1000","font-color":"black"});
 	var titleul=$("<ul>").addClass("list-group").append(titleli);      
 	$("#content").append(titleul);       	
	parseJson(json);
	$("[data-toggle='popover']").popover();
 }   
 
 function obj(key,element){
	 this.key=key;
	 this.element=element;
 }   
 
 function parseJson(json) {
	  for(var i=0;i<json.length;i++){
			jsonObj=json[i]
			var listEle=[]; 
	        var panel=$("<div>").addClass("panel  col-sm-12 col-md-6 col-lg-4 panel-"+panelClass[(i+1)%6]).css("padding",0).css("box-shadow","20px 10px 5px 20px #FFFF99").append("<span class='badge pull-left'>"+(i+1)+"</span>").append($("<div>").addClass("panel-heading").html("<span style='color:  black;background-color: #FFFFCC;border-radius: 44%;padding: 8px;margin:  5px 10px;display: inline-block;'>"+jsonObj.客户名称+"</span>"+"<span style='color:  black;background-color: #FFCC99;border-radius: 10px 30px;padding: 8px;margin: 5px 10px;display: inline-block;'>  "+jsonObj.房间+"</span>  <span style='color:  black;background-color: #CCFFFF;border-radius: 10px 30px;padding: 8px;margin: 5px 10px;display: inline-block;'>"+jsonObj.联系电话+"</span>")); 
		    var ul=$("<ul>").addClass("list-group")
		    // 循环所有键
		    for(var key in jsonObj) {
		        //如果对象类型为object类型且数组长度大于0 或者 是对象 ，继续递归解析
		        var element = jsonObj[key];
		        if(element.length > 0 && typeof(element) == "object" || typeof(element) == "object") {	        	
		        	listEle.push(new obj(key,element));
		        } else { //不是对象或数组、直接输出
		        	if(key=="insertDate"||key=="oid"||key=="projguid"||key=="tradeguid"){
		        		continue;
		        	}
		        	if(key=="contracturl"){
		        		var button=$("<button>").attr({
		        			 "type":"button",
		        			 "title":"注意！",   
		        			 "data-toggle":"popover", 
		        			 "data-placement":"top",
		        			 "data-trigger":"hover",
		        			 "data-content":"此按钮在已登陆明源的IE浏览器中点击方有效，否则单击右键复制链接至已登录明源的IE浏览器中打开",
		        		}).text("在明源查看合同详情").addClass("btn btn-success form-control input-medium");
		        		var li=$("<li>").addClass("list-group-item ").addClass(liclass[Math.floor(Math.random()*5)]).append($("<a href="+jsonObj.contracturl+" target='_blank' >").append(button)).css("text-align","left");
		        	}else{
		        	   var li=$("<li>").addClass("list-group-item ").addClass(liclass[Math.floor(Math.random()*5)]).append(key+":"+element).css("text-align","left");
		        	}
		        	ul.append(li);
	        }
	    }
		    //创建折叠面板组
		var panelGroup=$("<div>").addClass("panel-group");
		listEle.forEach(function(e,index){
			//用于容纳折叠头和折叠主体的div
			var collaPanel=$("<div>").addClass("panel  panel-"+panelClass[index+1]);
			//var btnclass=" btn  form-control input-medium btn-"+panelClass[Math.floor(Math.random()*5)];
			//console.info(btnclass)
			var phead=$("<div>").addClass("panel-heading").append($("<button>").css("text-align"," center").addClass("btn  form-control input-medium btn-"+panelClass[Math.floor(Math.random()*5)]).append($("<h4>").addClass("panel-title").attr({"data-toggle":"collapse","href":"#"+e.key+jsonObj.oid}).text(e.key)));
			var pbody=$("<div>").addClass("panel-body");
			if(!Array.isArray(e.element)){                                            //如果是不是数组
				var ul=$("<ul>").addClass("list-group");
				for(var key in e.element) {
					var element=e.element[key];
		        	var li=$("<li>").addClass("list-group-item ").addClass(liclass[Math.floor(Math.random()*5)]).append(key+":"+e.element[key]).css("text-align","left");
		            ul.append(li);
				}
				pbody.append(ul);
			}else{
				(e.element).forEach(function(ee,index){
					var ul=$("<ul>").addClass("list-group");
					for(var key in ee) {
						var element=ee[key];
						//console.info(element)
						if(key=="url"){
			        		var button=$("<button>").attr({
			        			 "type":"button",
			        			 "title":"注意！",   
			        			 "data-toggle":"popover", 
			        			 "data-placement":"top",
			        			 "data-trigger":"hover",
			        			 "data-content":"此按钮在已登陆明源的IE浏览器中点击方有效，否则单击右键复制链接至已登录明源的IE浏览器中打开",
			        		}).text("在明源中查看"+e.key+"详情").addClass("btn  form-control input-medium btn-"+panelClass[Math.floor(Math.random()*5)]);
			        		var li=$("<li>").addClass("list-group-item ").addClass(liclass[Math.floor(Math.random()*5)]).append($("<a href="+ee[key]+" target='_blank' >").append(button)).css("text-align","left");
						}else if(key=="其他信息"||key=="其他资料"){
							var li=$("<li>").addClass("list-group-item ").addClass(liclass[Math.floor(Math.random()*5)]).append(key+":"+JSON.stringify(ee[key])).css("text-align","left");
						}else{
			        	    var li=$("<li>").addClass("list-group-item ").addClass(liclass[Math.floor(Math.random()*5)]).append(key+":"+ee[key]).css("text-align","left");
						}
			            ul.append(li);
					}
					pbody.append(ul);
				})
			}
			var pbodyContainer=$("<div>").addClass("panel-collapse collapse").attr("id",e.key+jsonObj.oid).append(pbody);
			panelGroup.append(collaPanel.append(phead).append(pbodyContainer));
		});
	    var pbody=$("<div>").addClass("panel-body").append(ul).append(panelGroup);
	    pbody.appendTo(panel);
	    $("#content").append(panel);
	}
 }
	
function showTip(msg){
    $.alertable.alert(msg, {
      show: function() {
        $(this.overlay).velocity('transition.fadeIn');        
        $(this.modal).velocity('transition.flipBounceYIn');
      },
      hide: function() {
        $(this.overlay).velocity('transition.fadeOut');
        $(this.modal).velocity('transition.perspectiveUpOut');
      } 
  });  
}
