$(function(){
	
	$("#contractQryBtn").click(function (e) {
	    if($("#contractQryInput").val()==null||$("#contractQryInput").val()==""||$("#contractQryInput").val().length==0){
	    	showTip("请输入客户姓名或房号！");
	    	return;
	    }
	    var p = /[0-9]/;
	    var b = p.test($("#contractQryInput").val());
	    if(b==true&&$("#contractQryInput").val().length<4){
	    	showTip("房号查询字段太短，请输入更精确的房号...");
	    	return;
	    }
		$.ajax({
	        type : "POST",
	        url : "queryContractDetail",
	        data : {
	            "contractQryInput" : $("#contractQryInput").val(),
	        },
	        dataType : "json",
	        success : function(data) {
	        	if(data){
	        	  showContractDetail(data);
	        	}else{
	        		showTip("请求数据失败！");
	        	}
	        },
	        error:function(){
	        	showTip("请求过程中出错！");
	        },
	        timeout:function(){
	        	showTip("请求超时！");
	        }
		});
	});
	
	$('a[href="#orderquery"]').on('shown.bs.tab	', function (e) {
		if(flag==0){
			InitMainTable ();
			flag=1;
		}
	});
	$('a[data-toggle="pill"]').on('shown.bs.tab	', function (e) {
		$("[data-toggle='popover']").popover();
		});
	   $("#querybtn").click(function(){
		   var qrystr=$("#qryByDays").val();
		   var param;
		   if(qrystr==""||qrystr==null){
			   param={days:7};
		   }else if (!(/(^[1-9]\d*$)/.test(qrystr))) { 
			　　showTip("请输入正确的数字!");
		　　　return false; 
		   }else{
			   param={days:qrystr};
		   }  
		   $('#ordertable').bootstrapTable('refresh',param); 
	    }); 
   });
